import React from 'react';

import Card from '../card/card.component';
import './cardlist.styles.css';


const CardList = ({cats}) => {
	return(
		<div>
			{
				cats.map(cat => {
					<Card key={cat.id} name={cat.name} email={cat.email}/>
				})
			}
		</div>
	)
}

export default CardList
